import classes from './AgoraVideo.module.css';


const AgoraVideo=()=>{

return (

   <div className={classes.agoraVideo}>

        <div className={classes.joinWrapper}>

            <input id="username" 
	       type="text" 
	       placeholder="Enter your name..." 
	    />

            <button className={classes.joinStream}>Join Stream</button>
        </div>



   </div>	

);

}


export default AgoraVideo;
